// src/App.js
import React from 'react';
import './App.css';
import Header from './Header';
import About from './About';
import Projects from './Projects';
import Contact from './Contact';
import NavBar from './NavBar';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Header />
      <About />
      <Projects />
      <Contact />
    </div>
  );
}

export default App;
